import React from "react"

export default function SaladCheckbox({x, handleChange, state, price}) {
  return (
    <div className="col-md-3 padding" key={x}>
      <input
        type="checkbox"
        id={x}
        name="extra"
        onChange={handleChange}
        checked={state || false} 
      />
      <label className="pl-1" htmlFor={x}>{x} {price}kr</label>
      <br />
    </div>
  )
}
